svg.script:
function init(evt){
    if ( window.svgDocument == null ) {
    svgDocument = evt.target.ownerDocument;
    svgDocument.sortLU = this.sortLU;
    svgDocument.sortLUrev = this.sortLUrev;
    var mainDocument = window.parent.document;
    mainDocument.addEventListener("landUseTrigger", sortLU, false);
    }
}
var highlightBaseHeight = Number(document.getElementById("highlight-fill").getAttribute("height"));
var swaps = [[3,29],[5,20],[6,28],[7,3],[15,16],[15,17],[15,18],[15,19],[15,5],[15,21],[15,22],[15,23],[15,24],[15,25],[15,26],[15,27],[15,6],[15,7],[8,9],[8,10],[8,11],[8,12],[8,13],[8,16],[14,17],[8,18],[14,19],[8,5],[14,21],[8,22],[14,25],[8,26],[23,27],[24,6],[14,8],[14,24],[16,17],[16,18],[16,19],[16,5],[16,21],[16,22],[16,25],[16,26],[16,27],[9,10],[9,17],[11,18],[12,19],[13,5],[9,21],[11,25],[12,26],[9,22],[9,11],[10,5],[17,25],[18,21],[10,18],[20,28]]
var revswaps = [[29,4],[29,3],[28,5],[20,10],[29,13],[28,11],[25,9],[21,12],[19,6],[18,8],[20,14],[17,7],[26,15],[29,22],[29,25],[28,21],[29,16],[28,19],[27,18],[29,24],[28,23],[27,20],[29,17],[28,26],[29,28],[22,16],[25,17],[21,19],[22,18],[21,20],[22,21],[24,22],[19,18],[10,6],[13,7],[14,13],[11,8],[12,10],[12,11],[4,3]]
	 var svg = document.querySelector("svg")
     	 var pt = svg.createSVGPoint();
     	 var toolkeys = {"meanFiber":"Fiber & Lines","meanPellet":"Beads & Pellets", "meanFilm":"Films", "meanFoam":"Foams", "meanFrag":"Fragments", "UrbanPct":"Urban", "AgTotalPct":"Agriculture", "OtherPct":"Other"}
     	 var xmax = Number(svg.getAttribute("viewBox").split(" ")[2]);
function sortLU(){
	 var i = 0;
	 window.myInterval = setInterval(function () {
		 if (i < swaps.length){
			 var x0 = document.getElementById(swaps[i][0] + "-meanFiber").getAttribute("x");
			 var x1 = document.getElementById(swaps[i][1] + "-meanFiber").getAttribute("x");
			 var tr0vals = document.getElementById("site-" + swaps[i][0]).getAttribute("transform").split(/[,()]+/);
			 var tr1vals = document.getElementById("site-" + swaps[i][1]).getAttribute("transform").split(/[,()]+/);
			 var tr0new = tr0vals[0]+"("+tr1vals[1]+","+tr0vals[2]+") "+tr0vals[3]+"("+tr0vals[4]+")"
			 var tr1new = tr1vals[0]+"("+tr0vals[1]+","+tr1vals[2]+") "+tr1vals[3]+"("+tr1vals[4]+")"
			 document.getElementById("site-" + swaps[i][0]).setAttribute("transform", tr0new);
			 document.getElementById("site-" + swaps[i][1]).setAttribute("transform", tr1new);
			 document.getElementById(swaps[i][0] + "-UrbanPct").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-AgTotalPct").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-OtherPct").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-meanPellet").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-meanFilm").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-meanFoam").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-meanFrag").setAttribute("x", x1);
			 document.getElementById(swaps[i][0] + "-meanFiber").setAttribute("x", x1);
			 document.getElementById(swaps[i][1] + "-UrbanPct").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-AgTotalPct").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-OtherPct").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-meanPellet").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-meanFilm").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-meanFoam").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-meanFrag").setAttribute("x", x0);
			 document.getElementById(swaps[i][1] + "-meanFiber").setAttribute("x", x0);
			 i++
		} else {
			 clearInterval(window.myInterval);
	}}, 25)
}
function sortLUrev(){
	 var i = 0;
	 window.myInterval = setInterval(function () {
		 if (i < revswaps.length){
			 var x0 = document.getElementById(revswaps[i][0] + "-meanFiber").getAttribute("x");
